        "$:/language/Modals/Download": {
            "title": "$:/language/Modals/Download",
            "type": "",
            "subtitle": "Download changes",
            "footer": "<$button message=\"tm-close-tiddler\">Close</$button>",
            "help": "https://tiddlywiki.com/static/DownloadingChanges.html",
            "text": "متصفحك يدعم فقط الحفظ اليدوي.\n\nلحفظ ويكي المعدل ، انقر بزر الماوس الأيمن على رابط التنزيل أدناه واختر \"تنزيل ملف\" أو \"حفظ ملف\" ، ثم اختر المجلد واسم الملف.\n\n// يمكنك تسريع الأمور بشكل هامشي عن طريق النقر فوق الارتباط بمفتاح التحكم (Windows) أو مفتاح الخيارات / alt (Mac OS X). لن تتم مطالبتك بالمجلد أو اسم الملف ، ولكن من المحتمل أن يعطيه المستعرض اسمًا لا يمكن التعرف عليه - قد تحتاج إلى إعادة تسمية الملف لتضمين ملحق `.html` قبل أن تتمكن من القيام بأي شيء مفيد معه. //\n\nعلى الهواتف الذكية التي لا تسمح بتنزيل الملفات ، يمكنك بدلاً من ذلك وضع إشارة مرجعية على الرابط ، ثم مزامنة إشاراتك المرجعية مع كمبيوتر سطح المكتب حيث يمكن حفظ موقع wiki بشكل طبيعي."
        },
        "$:/language/Modals/SaveInstructions": {
            "title": "$:/language/Modals/SaveInstructions",
            "type": "",
            "subtitle": "Save your work",
            "footer": "<$button message=\"tm-close-tiddler\">Close</$button>",
            "help": "https://tiddlywiki.com/static/SavingChanges.html",
            "text": "يجب حفظ التغييرات التي قمت بها على هذا الويكي كملف تدلي ويكي بامتداد HTML .\n\n!!! متصفحات سطح المكتب\n\n# أختر/ي \"حفظ باسم\" من قائمة \"ملف\"\n# اختر/ي اسم الملف وموقعه\n# * تتطلب بعض المتصفحات أيضًا تحديد تنسيق حفظ الملف بشكل صريح كـ \"صفحة الويب ، HTML فقط\" أو ما شابه\n# أغلق علامة التبويب هذه\n\n!!! متصفحات الهواتف الذكية\n\n# إنشاء بوك مارك لهذه الصفحة\n# * إذا قمت بإعداد iCloud أو Google Sync ، فستتم مزامنة الإشارة المرجعية تلقائيًا إلى سطح المكتب حيث يمكنك فتحه وحفظه كما هو موضح أعلاه\n# أغلق علامة التبويب هذه\n\n// إذا فتحت البوك مارك مرة أخرى في متصفح سفاري للموبايل ، فستظهر لك هذه الرسالة مرة أخرى. إذا كنت تريد المضي قدمًا واستخدام الملف ، فما عليك سوى النقر فوق الزر \"إغلاق\" أدناه //\n"
        },
